import React, {useState} from 'react';

class SignUp extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            name:"user",
            form:this.welcome
        };
        this.question1 = <div>
            <h1>That's a great name {this.state.name}</h1>
        </div>

    }

    //Welcome message. First page
    welcome=<div>
    <h1>Looks like you're new around here</h1>
    <h2>Lets get you signed up</h2>
    <h2>We'll start with a name</h2>
        <form onSubmit={(e)=>{this.handleName(e)}}>
            <input type="text" onChange={(e)=>{this.setState({name:e.target.value})}}></input>
            <button>That's my name</button>
        </form>
    </div>

    //Qustion 1 (sex)

    handleName =(e)=>{
        e.preventDefault();
        this.setState({form:this.question1});
    }

    render(){
        return(
            <div className="SignUp" >
            {this.state.form}
            </div>
        )

    }
}

export default SignUp;
